import React from 'react';
import Greet from './Greet';

// Inside React Fragments we can only pass JSX , not React.createElement();

function add(a, b) {
	return a + b;
}

// Whwnever we call a method it is first searched inside the components then only

function App() {

	function subtract(a, b) {
		return a - b;
	}

	return (
		<>
			<h1> Sum is {subtract(12, 3)} </h1>
			<h1> Sum is {add(2, 3)} </h1>
			<Greet />
		</>
	);
}

export default App;
